import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <p>
          <code>Amitesh Singh first Docker project app.</code>
        </p>
        <a
          className="App-link"
          href="https://www.espncricinfo.com/series/icc-men-s-t20-world-cup-2024-1411166"
          target="_blank"
          rel="noopener noreferrer"
        >
          Surf Website
        </a>
      </header>
    </div>
  );
}

export default App;
